ピッチングやバッティング、フィールディングといったあらゆるフォームを躍動させるため、<br>
野球独自の動きを徹底して追求。その適度なホールドが運動時の筋肉の揺れを軽減し、<br>
疲れを解消する効果も発揮。その優れた吸汗速乾性能が、心身のコンディションをベストに保ちます。<br>
また新たに採用されたUVカット素材で疲労の一因ともされる日焼け対策になるだけでなく、<br>
直射日光に含まれる赤外線もカット。夏場のプレーに、特にオススメです。
<br>■メーカー情報■<br>
●ミズノ バイオギア アンダーシャツ ハイネック 七分袖<br>
●素材：ドライアクセルuv<br>
●ポリエステル84％・ポリウレタン16％<br>
●衿の高さ：5.5cm<br>
●サイズ：s,m,l,o,xo<br><br>【野球のことならムサシ】
